#include<bits/stdc++.h>using namespace std;typedef long long ll;void f(ll n,vector<ll>&a){    for(ll i=0;i<n;i++)cin>>a[i];}void solve(){    ll n,k;    cin>>n>>k;    vector<ll>vec(n);    f(n,vec);    sort(begin(vec),end(vec));    vector<ll> good;    // vector<pair<ll, ll>> freq_list;    for (ll i=0;i<n;) {        ll j=i;        while(j<n && vec[j]==vec[i])j++;        if(j-i>=k)good.push_back(vec[i]);        i=j;    }        if (good.empty()) {        cout << -1 << "\n";        return;    }    ll bestL=good[0],bestR=good[0];    ll  currL=good[0],currR=good[0];    ll mx_len=1;    for (ll i = 1; i <(ll)good.size();i++)    {        if(good[i]==good[i-1]+1)currR=good[i];        else{            if(currR-currL+1>mx_len){                mx_len=currR-currL+1;                bestL=currL;                bestR=currR;            }            currL=currR=good[i];        }    }    if(currR-currL+1>mx_len){        mx_len=currR-currL+1;        bestL=currL;        bestR=currR;    }    cout<<bestL<<" "<<bestR<<'\n';}int main(){ll t;cin>>t;while (t--){    solve();}Â     return 0;}